import { Fragment } from "react";
import classes from "./HotelLists.module.css";
const HotelList = () => {
  const Dummy_Hotel = [
    {
      name: "Hotels",
      count: 233,
      image: "./images/type_1.webp",
    },
    {
      name: "Apartments",
      count: 2331,
      image: "./images/type_2.jpg",
    },
    {
      name: "Resorts",
      count: 2331,
      image: "./images/type_3.jpg",
    },
    {
      name: "Villas",
      count: 2331,
      image: "./images/type_4.jpg",
    },
    {
      name: "Cabins",
      count: 2331,
      image: "./images/type_5.jpg",
    },
  ];
  return (
    <Fragment>
      <h1></h1>
      <div className={classes.hotels}>
        <div>
          <img
            className={classes.img}
            src={Dummy_Hotel[0].image}
            alt={Dummy_Hotel[0].name}
          />
          <div className={classes.text}>
            <h1>{Dummy_Hotel[0].name}</h1>
            <h3>{Dummy_Hotel[0].count} Hotel</h3>
          </div>
        </div>

        <div>
          <img
            className={classes.img}
            src={Dummy_Hotel[1].image}
            alt={Dummy_Hotel[1].name}
          />
          <div className={classes.text}>
            <h1>{Dummy_Hotel[1].name}</h1>
            <h3>{Dummy_Hotel[1].count} Hotel</h3>
          </div>
        </div>
        <div>
          <img
            className={classes.img}
            src={Dummy_Hotel[2].image}
            alt={Dummy_Hotel[2].name}
          />
          <div className={classes.text}>
            <h1>{Dummy_Hotel[2].name}</h1>
            <h3>{Dummy_Hotel[2].count} Hotel</h3>
          </div>
        </div>
        <div>
          <img
            className={classes.img}
            src={Dummy_Hotel[3].image}
            alt={Dummy_Hotel[3].name}
          />
          <div className={classes.text}>
            <h1>{Dummy_Hotel[3].name}</h1>
            <h3>{Dummy_Hotel[3].count} Hotel</h3>
          </div>
        </div>
        <div>
          <img
            className={classes.img}
            src={Dummy_Hotel[4].image}
            alt={Dummy_Hotel[4].name}
          />
          <div className={classes.text}>
            <h1>{Dummy_Hotel[4].name}</h1>
            <h3>{Dummy_Hotel[4].count} Hotel</h3>
          </div>
        </div>
      </div>
    </Fragment>
  );
};
export default HotelList;
